import { sharex } from 'helux';

const { reactive, useReactive } = sharex({
  a: 1,
  b: { b1: { b2: 1, ok: true } },
});

setInterval(() => {
  reactive.a += 1;
  reactive.b.b1.b2 += 5;
}, 2000);

function toogleOkOut() {
  reactive.b.b1.ok = !reactive.b.b1.ok;
}

function Demo() {
  const [reactive, , info] = useReactive();
  return <MarkUpdate info={info}>a: {reactive.a}</MarkUpdate>;
}
